import React from "react";

const Header = () => {
  return (
    <div className="flex items-center justify-between px-12 md:px-20 py-6 fixed bg-opacity-90 bg-gray-100  backdrop-blur-md z-50 inset-x-0 top-0 ">
      Header
    </div>
  );
};

export default Header;
